import React from "react";
import "./SearchPage.css";
import { useStateValue } from "../StateProvider";
import useWebApi from "./useWebApi";
import { Link } from "react-router-dom";
import Search from "./Search";
import SearchIcon from "@mui/icons-material/Search";
import DescriptionOutlinedIcon from '@mui/icons-material/DescriptionOutlined';
import InsertPhotoOutlinedIcon from '@mui/icons-material/InsertPhotoOutlined';
import PlayArrowOutlinedIcon from '@mui/icons-material/PlayArrowOutlined';

function SearchPage() {
  const [{ term }, dispatch] = useStateValue();
  // const { data } = useWebApi(term);

  const data = Response;
  return (
    <div className="searchPage">
      <div className="searchPage_header">
        <Link to="/" style={{ textDecoration: "none" }}>
          <div className="title">Webpage</div>
        </Link>

        <div className="searchPage_headerBody">
          <Search hideShortCut />
          <div className="searchPage_option">
            <div className="searchPage_optionLeft">
              <div className="searchPage_option">
                <SearchIcon style={{ color: "gray" }} />
                <Link to="/all">All</Link>
              </div>
              <div className="searchPage_option">
                <DescriptionOutlinedIcon style={{ color: "gray" }} />
                <Link to="/news">News</Link>
              </div>
              <div className="searchPage_option">
                <InsertPhotoOutlinedIcon style={{ color: "" }} />
                <Link to="/image">Image</Link>
              </div>
              <div className="searchPage_option">
                <PlayArrowOutlinedIcon style={{ color: "grey" }} />
                <Link to="/video">Video</Link>
              </div>
              <div className="searchPage_option">
                <ImageIcon style={{ color: "white" }} />
                <Link to="/shopping">Shopping</Link>
              </div>
              <div className="searchPage_option">
                <ImageIcon style={{ color: "white" }} />
                <Link to="/maps">Maps</Link>
              </div>
            </div>
            <div className="searchPage_optionRight"></div>
          </div>
        </div>
      </div>
      <div className="searchPage_results"></div>
    </div>
  );
}

export default SearchPage;
